How to use FakeItEasy to verify FindOneAndUpdateAsync method ran Against faked MongoCollection?<p>I am using the <code>FakeItEasy</code> library for unit testing and trying to write a unit test for a mongo update statement and verify that the <code>FindOneAndUpdateAsync</code> method was called using <code>MustHaveHappened()</code>.</p>

<p>I have created a unit test that will fake the <code>dbcontext</code> class, use that to generate a collection, then call the method that will run the update statement against the fake collection. When I run the test in debug mode, it is hitting the <code>FindOneAndUpdateAsync</code> method, however the <code>MustHaveHappened()</code> result is showing that the method did not run against the faked collection.</p>

<p>Is there a way to use <code>FakeItEasy</code> to detect that the <code>FindOneAndUpdateAsync</code> method ran when the collection it is being run against is also being faked?</p>

<p><strong>Error Message from Failed Test</strong></p>

<blockquote>
  <p>Assertion failed for the following call:
      Any call made to the fake object.
        where x => (x.Method.Name == "FindOneAndUpdateAsync")
    Expected to find it once or more but didn't find it among the calls:
      1: MongoDB.Driver.IMongoCollection`1[ConsoleApp3.Fruit].WithWriteConcern(writeConcern: { w : "majority" })</p>
</blockquote>

<p><strong>Unit Test Using FakeItEasy</strong></p>

<pre><code>    [Fact]
    public async Task TestFruitUpdate()
    {
        IDBContext fakeDbContext = A.Fake&lt;DBContext&gt;();
        var fakeMongoCollection = A.Fake&lt;IMongoCollection&lt;Fruit&gt;&gt;();
        var fruitEntity = new Fruit()
        {
            Id = new MongoDB.Bson.ObjectId(),
            Name = "Apple",
            Price = 2.0,
            Quantity = 3,
        };

        A.CallTo(() =&gt; fakeDbContext.GetCollection&lt;Fruit&gt;()).Returns(fakeMongoCollection);
        A.CallTo(fakeDbContext).WithReturnType&lt;IMongoCollection&lt;Fruit&gt;&gt;().Returns(fakeMongoCollection);

        var repository = new FruitRepository(fakeDbContext);

        await repository.UpdateFruitQuantityAsync(fruitEntity);

        A.CallTo(fakeMongoCollection).Where(x =&gt; x.Method.Name == "FindOneAndUpdateAsync").MustHaveHappened();
    }
</code></pre>

<p><strong>Interface for DBContext</strong></p>

<pre><code>public interface IDBContext
{
    IMongoClient Client { get; }

    IMongoDatabase Database { get; }

    IMongoCollection&lt;TDocument&gt; GetCollection&lt;TDocument&gt;()
        where TDocument : Fruit;
}
</code></pre>

<p><strong>Fruit Entity</strong></p>

<pre><code>public class Fruit
{
    public ObjectId Id { get; set; }
    public string Name { get; set; }
    public double Price { get; set; }
    public int Quantity { get; set; }
}
</code></pre>

<p><strong>Fruit Repository Class</strong></p>

<pre><code>class FruitRepository
{
    private readonly IDBContext _dbContext;

    public FruitRepository(IDBContext dBContext) =&gt;
        _dbContext = dBContext;

    public virtual Task UpdateFruitQuantityAsync(Fruit fruitEntity) =&gt;
        _dbContext.GetCollection&lt;Fruit&gt;()
            .WithWriteConcern(WriteConcern.WMajority)
            .FindOneAndUpdateAsync(
                Builders&lt;Fruit&gt;.Filter.Eq(j =&gt; j.Id, fruitEntity.Id),
                Builders&lt;Fruit&gt;.Update.Set(j =&gt; j.Quantity, fruitEntity.Quantity)
             );
}
</code></pre>

