How to throw an error from an async mongoose middleware post hook<p>What's the correct way to throw an error from an async <a href="http://mongoosejs.com/docs/middleware.html" rel="nofollow noreferrer">Mongoose middleware</a> <strong>post hook</strong>? </p>

<h3>Code Example</h3>

<p>The following <strong>TypeScript</strong> code uses mongoose's post <code>init</code> event to run some checks that are triggered whenever a function retrieves a doc from mongoDb. The <code>postInit()</code> function in this example is executing some background checks. It is supposed to fail under certain circumstances and then returns a <code>Promise.reject('Error!');</code> </p>

<pre><code>schema.post('init', function (this: Query&lt;any&gt;, doc: any) {
    return instance.postInit(this, doc) 
    .catch( err =&gt; {
        return err;
    });
});
</code></pre>

<p>The hook works fine. I.e. the following code triggers the hook:</p>

<pre><code>MyMongooseModel.findOne({ _id : doc.id}, (err, o : any) =&gt; {
    console.log(o);
});
</code></pre>

<p>However, if <code>postInit()</code> fails, the error isn't passed back to the calling function. Instead, the document is returned. </p>

<h3>Expected behavior</h3>

<p>I'm looking for the right way to pass this error to the calling function. If the background checks fail, the calling function shouldn't get a document back. </p>

<p>I have tried different ways to raise this error. E.g. <code>throw new Error('Error');</code>. However, this causes an <code>UnhandledPromiseRejectionWarning</code>  and still returns the document.</p>

